Grateful for some unforgettable moments in the mountains and desert of Colorado ! 🌟

Immense gratitude to all the incredible sponsors who made our recent ‘Wild West’ charity expedition for the Invictus Games Foundation possible. Your unwavering support has allowed us to create unforgettable memories and changed lives.

Thank you for believing in us and our mission to empower wounded warriors through this expedition. Your generosity has not only made this journey a reality but has also brought hope and inspiration to countless individuals who have faced adversity. Your commitment to making a difference in the lives of those who have served our countries is testament to the power of the veteran community.

With your support, we were able to immerse ourselves in the invigorating power of nature as we hiked one of the most amazing trails in the USA, summiting Mt Herard and taking in the breathtaking landscapes of the Great Sand Dunes National Park; a sacred place for indigenous communities, which yet again proved its potential as a place of connection and healing. 

Moreover, your contributions helped us provide essential resources and opportunities for our veteran community to participate in a very special mission, fostering their physical and emotional well-being. 

@weareinvictusgames continues to empower these incredible individuals, proving that their injuries do not define them, but rather serve as a testament to their resilience and strength. 

We at @dunesdesertcamp look forward to continuing this incredible journey together, as we strive to make a lasting impact in the lives of those who have sacrificed so much for our freedom. 🌟💪🏼

