On this day 10 years ago I set off on my greatest adventure. To walk the length of the River Nile in Africa, all 4250 miles of it. I began here, at the source of the Nyabarongo river in Rwanda, the longest tributary of the world’s longest river. I had no idea how long the journey would take or whether it was even possible (it ended up taking 9 months). It was a journey that changed my life in so many ways and the one that kickstarted my writing and television career. Thanks to all those who have followed me ever since!
